import { getChatSource } from '../utils/source';

function HomePage() {
    const data = getChatSource();
    return
    (<div>
        <div>Welcome to Next.js!</div>
        {
            data.map((item, index) => <div key={index.toString()}>{item.msg}</div>)
        }
    </div>);
}

export default HomePage
